            function Add(uint _aa, uint _bb) public pure returns(uint) {
                return _aa + _bb;
            }


        //숫자 a와 b를 갖고와서 이 2개의 숫자를 더한 결과값을 반환하는 함수 Add2를 구현하세요//

            function Add2() public view returns(uint) {
                return a+b;
